<script>
  let count = 1;
  for (let i = 0; i < 100; i++) {
    if (document.querySelectorAll("#red-dot_" + i).length == 0) continue;
    count++;
  }
  console.log(count);
  count = 0;

  for (let i = 0; i < 100; i++) {
    if (document.querySelectorAll("#red-text_" + i).length == 0) continue;
    count++;
  }
  console.log(count);

  gsap.registerPlugin(ScrollTrigger);
  let animBoolean = false;
  let progress = 0;
  let scrollProgress = 0;

  const group_1 = gsap.timeline({ paused: true });

  group_1.from("#circle-1", {
    scale: 0,
    duration: 2,
    ease: "Elastic.easeOut",
    transformOrigin: "center",
  });

  group_5.from("#circle-5", {

    transformOrigin: "center",

  group_5.from(

  // const group_6 = gsap.timeline({ paused: true });
  group_5.from(
    ["#target-inside", "#target-outside"],
    {
      scale: 0,
      duration: 1,
      ease: "Elastic.easeOut",
      stagger: 0.1,
      transformOrigin: "center",
    },
    "<+=0.5"
  );

  group_5.from(
    "#dashed-path",
    {
      opacity: 0,
      scale: 0,
      duration: 1,
      transformOrigin: "top center",
      ease: "Power3.easeOut",
    },
    "<+=0.3"
  );

  var lineDrawing = anime({
    targets: "#path",
    strokeDashoffset: [anime.setDashoffset, 0],
    easing: "easeInOutCubic",
    duration: 4000,
    autoplay: false,
    update: function (anim) {
      if (anim.progress > progress) {
        progress = anim.progress;
      }

      if (Math.round(progress) >= 32) {
        group_1.play();
      }

      if (Math.round(progress) >= 42) {
        group_2.play();
      }

      if (Math.round(progress) >= 50) {
        group_3.play();
      }

      if (Math.round(progress) >= 58) {
        group_4.play();
      }

      if (Math.round(progress) >= 70) {
        group_5.play();
      }

      if (Math.round(progress) == 100) {
        animBoolean = true;
      }
    },
  });

  const scrollPercent = () => {
    const bodyST = document.body.scrollTop;
    const docST = document.documentElement.scrollTop;
    const docSH = document.documentElement.scrollHeight;
    const docCH = document.documentElement.clientHeight;

    return ((docST + bodyST) / (docSH - docCH)) * 180;
  };

  window.onscroll = () => {
    if (animBoolean == false) {
      if (scrollProgress < (scrollPercent() / 100) * lineDrawing.duration) {
        scrollProgress = (scrollPercent() / 100) * lineDrawing.duration;
      }
      if (Math.round(progress) < 70) {
        lineDrawing.seek(scrollProgress);
      } else {
        lineDrawing.play();
      }
      // lineDrawing.seek(scrollProgress);
    } else {
      lineDrawing.pause();
    }
  };

  const lenis = new Lenis({
    duration: 2.5,
    easing: (t) => Math.min(1, 1.001 - Math.pow(2, -10 * t)),
    direction: 'vertical', // vertical, horizontal
    gestureDirection: 'vertical', // vertical, horizontal, both
    smooth: true,
    mouseMultiplier: 1,
    smoothTouch: false,
    touchMultiplier: .5,
    infinite: false,
  });

  function raf(time) {
    lenis.raf(time);
    requestAnimationFrame(raf);
  }

  requestAnimationFrame(raf);

  //   gsap.from("#marcom-360-title", {

  const circleTimeline = gsap.timeline({

  // circleTimeline.from(["#comunicacao-marketing", "#okris"], {

  );

  circleTimeline.from(
    "#outter-circle",
    {
      scale: 0,
      duration: 1,
      ease: "Power3.easeOut",
      transformOrigin: "center",
    },
    0.5
  );

  circleTimeline.from(
    Array.from({ length: 7 }, (v, k) => "#line_" + (k + 1)).concat(["#line"]),
    {

      duration: 1,
      ease: "Power3.easeOut",
      transformOrigin: "center center",

  circleTimeline.from(
    Array.from({ length: 8 }, (v, k) => "#black-dot_" + (k + 1)).concat([

</script>
